def big_primefac_div(n):
    if isinstance(n, float) and n % 1 != 0:
        return "The number has a decimal part. No Results"

    n = abs(int(n))

    if n < 2:
        return []

    highest_prime = None
    highest_divisor = None

    def prime_factors(num):
        factors = []
        for i in range(2, int(num**0.5) + 1):
            while num % i == 0:
                factors.append(i)
                num //= i
        if num > 1:
            factors.append(num)
        return factors

    factors = prime_factors(n)

    if not factors:
        return []

    highest_prime = max(factors)
    highest_divisor = n // highest_prime

    return [highest_prime, highest_divisor]
