        factor = -1
        for i in range(2, int(num**0.5) + 1):
            while num % i == 0:
                factor = i
                num //= i
        if num > 1:
            factor = num
        return factor

    def highest_divisor(num):
        for i in range(num // 2, 0, -1):
            if num % i == 0:
                return i
        return None

    if n < 2:
        return []

    hp_factor = highest_prime_factor(n)
    if hp_factor == n:
        return []

    h_divisor = highest_divisor(n)

    return [hp_factor, h_divisor]
